import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { LineChart, Line, BarChart, Bar, PieChart, Pie, Cell, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import twitterResponse from '/Users/dharshanm/Desktop/project /client/src/performance_predictions.json'
import instagramResponse from '/Users/dharshanm/Desktop/project /client/src/segmentation_results.json'
import spotifyResponse from '/Users/dharshanm/Desktop/project /client/src/churn_predictions.json'



console.log(twitterResponse)
console.log(instagramResponse)
console.log(spotifyResponse)

const Dashboard = () => 
    {
        const [chartData, setChartData] = useState([]);

    useEffect(() => {
        // Transform the data to match the chart format
        const transformedData = spotifyResponse.actual.map((value, index) => ({
            name: index,
            actual: value,
            predicted: spotifyResponse.predicted[index],
        }));
        setChartData(transformedData);
    }, []);

    const [chartDatatweet, setChartDatatweet] = useState([]);

    useEffect(() => {
        // Transform the data to match the chart format
        const transformedDatatweet = twitterResponse.actual.map((value, index) => ({
            name: index,
            actual: value,
            predicted: twitterResponse.predicted[index],
        }));
        setChartDatatweet(transformedDatatweet);
    }, []);

 const [chartDatainsta, setChartDatainsta] = useState([]);

    useEffect(() => {
        if (instagramResponse && Array.isArray(instagramResponse)) {
            // Directly use the provided data
            const transformedDatainsta = instagramResponse.map((item, index) => ({
                name: `User ${index + 1}`,
                username: item.username,
                segment: item.segment,
            }));
            setChartDatainsta(transformedDatainsta);
        }
    }, []);


  return (
    <div>
      <h1>Social Media Analytics Dashboard</h1>

      {/* Twitter Performance Prediction */}
      <h2>Twitter Performance Prediction</h2>
        <ResponsiveContainer width="100%" height={400}>
            <LineChart data={chartDatatweet}>
                <Line type="monotone" dataKey="actual" stroke="#8884d8" />
                <Line type="monotone" dataKey="predicted" stroke="#82ca9d" />
                <CartesianGrid stroke="#ccc" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Legend />
            </LineChart>
        </ResponsiveContainer>


      {/* Twitter Metrics */}
      <h2>Twitter Metrics</h2>
      <ResponsiveContainer width="100%" height={300}>

      </ResponsiveContainer>






      {/* Instagram User Segmentation */}
      <h2>Instagram User Segmentation</h2>
       <ResponsiveContainer width="100%" height={400}>
                <LineChart data={chartDatainsta}>
                    <Line type="monotone" dataKey="username" stroke="#8884d8" />
                    <Line type="monotone" dataKey="segment" stroke="#82ca9d" />
                    <CartesianGrid stroke="#ccc" />
                    <XAxis dataKey="name" />
                    <YAxis />
                    <Tooltip />
                    <Legend />
                </LineChart>
            </ResponsiveContainer>







      {/* Instagram Metrics */}
      <h2>Instagram Metrics</h2>
      <ResponsiveContainer width="100%" height={300}>

      </ResponsiveContainer>

      {/* Spotify Churn Prediction */}
      <h2>Spotify Churn Prediction</h2>

        <ResponsiveContainer width="100%" height={400}>
            <LineChart data={chartData}>
                <Line type="monotone" dataKey="actual" stroke="#8884d8" />
                <Line type="monotone" dataKey="predicted" stroke="#82ca9d" />
                <CartesianGrid stroke="#ccc" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Legend />
            </LineChart>
        </ResponsiveContainer>



      {/* Spotify Metrics */}
      <h2>Spotify Metrics</h2>
      <ResponsiveContainer width="100%" height={300}>

      </ResponsiveContainer>
    </div>
  );
};

export default Dashboard;
